INSERT INTO `wp_instagram` (`id`, `url`, `image_path`, `video_path`, `caption`, `likes`, `comments`) VALUES
	(49, 'CYY8S-Rs4k-', 'assets/images/instagram-media/CYY8S-Rs4k-.png', '', 'Pelo que vocÃª Ã© grato hoje?\n\nPode ser algo que passa despercebido todos os dias, mas que faz toda a diferenÃ§a: acordar. Pode ser por uma refeiÃ§Ã£o, pela sua famÃ­lia, pelos seus amigos, pela sua saÃºde, pelo seu emprego. Sempre vai existir um motivo para olharmos a vida pelo lado bom. E concordar com essa afirmaÃ§Ã£o jÃ¡ Ã© meio caminho andado.\n\nHoje Ã© o #DiadaGratidÃ£o: um sentimento tÃ£o importante a ponto de beneficiar diretamente a nossa saÃºde mental. Ter o hÃ¡bito de agradecer melhora o nosso humor, minimiza as emoÃ§Ãµes tÃ³xicas, nos ajuda a encontrar a felicidade e, o mais importante, beneficia os nossos relacionamentos.\n\nVocÃª Ã© grato por ter alguÃ©m na sua vida? Diga isso a ela com uma marcaÃ§Ã£o aqui nesse post. ðŸ’š\n\n#DiaDaGratidÃ£o', '392', '106'),
	(50, 'CYWZ3AjNhsf', 'assets/images/instagram-media/CYWZ3AjNhsf.png', '', 'Deu tudo MUITO certo!\n\nO Desafio de Pedal SESI chega ao fim e nÃ³s estamos com aquela sensaÃ§Ã£o de missÃ£o cumprida. Muito orgulho de todos os participantes que pedalaram mais de 400 km na etapa do mÃªs de dezembro e finalizaram o desafio de quatro meses com um total de 1.000 km pedalados!\n\nQue demostraÃ§Ã£o de disciplina, forÃ§a e comprometimento com a saÃºde vocÃªs deram.\n\nEssa conquista - e a mandala de medalhas â€“ Ã© toda de vocÃªs.\n\nGarantiu a sua? NÃ£o esqueÃ§a de marcar o SESI quando publicar suas fotos nas redes sociais. Essas fotos lindas sÃ£o do @kruger.evandro ðŸ¤©\n\nAtÃ© o prÃ³ximo desafio!\n\n#DesafioPedal #SESISaÃºde', '340', '16'),
	(51, 'CYMKX-Stuo_', 'assets/images/instagram-media/CYMKX-Stuo_.png', 'assets/images/instagram-media/CYMKX-Stuo_.mp4', 'Todo ano vocÃª faz uma lista de metas. Mas nÃ£o cumpre nenhuma ou quase nenhuma delas.\n\nOs Ãºltimos anos tÃªm sido muito desafiadores e acumular listas e mais listas de objetivos pode aumentar ainda mais a sensaÃ§Ã£o de esgotamento e de frustraÃ§Ã£o, impactando o nosso bem-estar psicolÃ³gico e a nossa produtividade.\n\nO Janeiro Branco aproveita o simbolismo do inÃ­cio do ano para redefinir atitudes que favoreÃ§am a nossa saÃºde mental. EntÃ£o, que tal comeÃ§ar o ano refletindo sobre o que Ã© realmente importante para vocÃª?\n\nA maior meta de 2022 Ã© seu bem-estar. E conte com o SESI para cultivar o que te faz bem!\n\n#JaneiroBranco #IssoMeFazBem', '39', '0'),
	(52, 'CYG6ZbUhCjw', 'assets/images/instagram-media/CYG6ZbUhCjw.png', 'assets/images/instagram-media/CYG6ZbUhCjw.mp4', 'Escolher uma roupa baseada nas nossas esperanÃ§as para o prÃ³ximo ano Ã© uma prÃ¡tica muito comum durante as festas de RÃ©veillon. \n\nDizem que amarelo traz prosperidade, o verde promete esperanÃ§a e saÃºde, e o branco, jÃ¡ tradicional, remete Ã  paz. Mas por que escolher, se podemos ter um pouquinho de tudo? \n\nFica a nossa dica para a virada: programe as suas metas e as suas atitudes para o bem. Tudo o que vocÃª precisa vem de dentro. Lembre-se disso: mais importante que a cor da roupa Ã© o pensamento e o desejo de ser melhor! Feliz 2022! \n\n#SouSESI', '53', '4'),
	(53, 'CX_P49SoeWF', 'assets/images/instagram-media/CX_P49SoeWF.png', 'assets/images/instagram-media/CX_P49SoeWF.mp4', 'E pensar que o vÃ­deo mostra apenas uma pequena parte do que aconteceu este ano! Foi muito trabalho, foram muitas conquistas. Em 2022 teremos muito mais! #SouSESI', '322', '32'),
	(54, 'CX3YCKIIvHv', 'assets/images/instagram-media/CX3YCKIIvHv.png', 'assets/images/instagram-media/CX3YCKIIvHv.mp4', 'Que a saÃºde esteja sempre presente para aproveitar as coisas boas e enfrentar os desafios. \nE que apesar dos desafios, a gente preserve a esperanÃ§a. \nQue essa esperanÃ§a seja alimentada pelo conhecimento. \nE que o conhecimento proporcione novas descobertas. \nE que em cada descoberta, grandes oportunidades estejam sempre brilhando para todos. \nBoas festas! SÃ£o os votos do SESI/RS para vocÃª. âœ¨ðŸ’š\n#SouSESI', '350', '11'),
	(55, 'CX1vN3gsdLy', 'assets/images/instagram-media/CX1vN3gsdLy.png', '', 'Para um sonho, nunca Ã© tarde. Os nossos alunos da EJA estÃ£o se formando e o sentimento de orgulho que sentimos Ã© indescritÃ­vel. Mesmo com todas as responsabilidades do dia a dia, eles encontraram um tempo para concluÃ­rem os estudos e, por isso, merecem todo o nosso reconhecimento. ParabÃ©ns por essa conquista! O SESI/RS acredita muito no poder transformador da EducaÃ§Ã£o e vocÃªs sÃ£o a prova disso. \n\nNas fotos estÃ£o sÃ³ alguns de nossos formandos, mas os nossos aplausos sÃ£o para todos os alunos, de todos os polos, que concluÃ­ram a sua jornada conosco. \n\nVem mudar a histÃ³ria da sua vida conosco tambÃ©m! Quer concluir os seus estudos? As inscriÃ§Ãµes para as prÃ³ximas turma da EJA estÃ£o abertas. Mais informaÃ§Ãµes no link da bio. \n\n#EJAdoSESI #SESIEducaÃ§Ã£o', '140', '0'),
	(56, 'CX1VOvvLAWW', 'assets/images/instagram-media/CX1VOvvLAWW.png', '', 'Durante a semana, os nossos alunos das Escolas SESI de Ensino MÃ©dio (@escolasesirs ) receberam os canudos que simbolizam o fim de um ciclo. E o inÃ­cio de infinitas possibilidades! âœ¨ Sabemos que o caminho da EducaÃ§Ã£o exige dedicaÃ§Ã£o, mas Ã©, com certeza, transformador e, durante as formaturas, podemos provar isso por meio do brilho nos olhos dos nossos alunos. \n\nÃ‰ com imensa alegria e satisfaÃ§Ã£o que realizamos essas solenidades. Cada formando representa, na prÃ¡tica, o poder transformador da EducaÃ§Ã£o na sociedade. E Ã© nisso que acreditamos muito!\n\nA todos eles, desejamos muito sucesso daqui para frente. E continuem contando conosco! ðŸ’š \n\n#SESIEducaÃ§Ã£o #EscolaSESI \n\nðŸ“¸ Dudu Leal\nðŸ“¸ @shalonarts_', '185', '0'),
	(57, 'CXtL-KWOAVq', 'assets/images/instagram-media/CXtL-KWOAVq.png', '', 'Quem tÃ¡ precisando de uma injeÃ§Ã£o de Ã¢nimo para terminar o ano? Essa sequÃªncia de fotos vai te ajudar! ðŸ¤©\n\nPara as alunas da academia do SESI de GuaÃ­ba, literalmente, nÃ£o tem tempo ruim. FaÃ§a chuva ou faÃ§a sol, elas seguem o treino com foco e estÃ£o sempre superando os seus prÃ³prios limites. \n\nâ€œDesde que iniciei os treinos, eu me sinto outra pessoa. Aqui as pessoas sÃ£o muito amÃ¡veis e tratam os alunos com muito carinhoâ€, conta Irene FlorÃªncio. \n\nAs nossas equipes de orientadores refletem, na prÃ¡tica, uma das coisas que o SESI/RS mais preza em relaÃ§Ã£o Ã  comunidade: promover bem-estar e qualidade de vida para todos. ðŸ’š\n\nðŸ“¸ @viniciusvogel \n\n#SESISaÃºde #AcademiaSESI', '222', '24'),
	(58, 'CXjDruGO_Mu', 'assets/images/instagram-media/CXjDruGO_Mu.png', '', 'Localizadas nas cidades de GravataÃ­, Montenegro, Pelotas, Sapucaia do Sul e SÃ£o Leopoldo, as Escolas de Ensino MÃ©dio do SESI tem o cenÃ¡rio ideal para que os alunos se tornem os protagonistas das suas prÃ³prias histÃ³rias!\n\nEnsino inovador, com metodologia inspirada nas melhores prÃ¡ticas nacionais e internacionais, infraestrutura diferenciada e tecnologia que potencializa a aprendizagem, aqui o estudante desenvolve seu conhecimento com criatividade e autonomia.\n\nE a melhor parte: as inscriÃ§Ãµes ainda estÃ£o abertas para vagas remanescentes e formaÃ§Ã£o de suplentes. Participe do processo seletivo e venha conhecer as cenas do prÃ³ximo capÃ­tulo da sua vida. O link estÃ¡ na bio.\n\n#SESIEducaÃ§Ã£o #EscolaSESI', '302', '5'),
	(59, 'CXhA9S6NkoW', 'assets/images/instagram-media/CXhA9S6NkoW.png', '', 'VocÃª jÃ¡ ouviu falar nos agentes estressores?\n\nTodos os dias, somos expostos a circunstÃ¢ncias que servem de gatilho para o estresse. SÃ£o os chamados agentes estressores, que podem ter origem interna (ligados Ã  personalidade da pessoa) ou externa (ligados ao ambiente). O estresse gerado por eles dependerÃ¡ do significado que o agente tem para a pessoa e da forma como ela lida com ele.\n\nVocÃª costuma ficar mais estressado no final do ano?  Saber administrar os agentes estressores, aumentar a resistÃªncia aos seus impactos e mudar a forma de enfrentÃ¡-los pode ser uma fÃ³rmula para impedir a evoluÃ§Ã£o do estresse.\n\nPor isso, lembramos algumas dicas para vocÃª manter o estresse sob controle e passar o fim de ano mais tranquilo:\n\n- Pratique atividades fÃ­sicas.\n- Cuide da sua alimentaÃ§Ã£o.\n- Evite o consumo de Ã¡lcool e cigarro.\n- EstabeleÃ§a limites e saiba dizer â€œnÃ£oâ€.\n- Gerencie seu tempo.\n- Cuide da qualidade do seu sono.\n- Reserve um perÃ­odo para fazer o que gosta.\n- NÃ£o tenha medo de buscar ajuda mÃ©dica, se achar necessÃ¡rio.\n\n#SaÃºdeMental #SESISaÃºde', '66', '0'),
	(60, 'CXTf0t4uSnK', 'assets/images/instagram-media/CXTf0t4uSnK.png', '', 'Quase 90 mil vacinas contra Covid-19 aplicadas pelo SESI no Rio Grande do Sul! ðŸ’‰\n\nSÃ³ na capital, atÃ© o final de novembro, foram aplicadas mais de 30 mil doses. Em Caxias do Sul, 45 mil doses. Em SÃ£o Leopoldo, o SESI vacinou mais de 11 mil trabalhadores da indÃºstria.\n\nPor meio das unidades mÃ³veis e equipes de profissionais, alÃ©m das aplicaÃ§Ãµes, atuamos na logÃ­stica de distribuiÃ§Ã£o, controle de retorno das doses e coordenaÃ§Ã£o de pontos de vacinaÃ§Ã£o em diversas cidades do estado.\n\nVacina Ã© sinÃ´nimo de saÃºde. E saÃºde Ã© um compromisso do SESI! ðŸ’š\n\nðŸ“¸ Dudu Leal\n\n#SESISaÃºde', '363', '8');
