INSERT INTO `wp_origincode_videoorigincode_gallery_videos` (`id`, `name`, `videogallery_id`, `description`, `image_url`, `sl_url`, `sl_type`, `link_target`, `ordering`, `published`, `published_in_sl_width`, `thumb_url`, `show_controls`, `show_info`) VALUES
	(1, 'Birdy - People Help The People', '1', '<p>People Help The People by Cherry Ghost performed by Birdy from her self titled debut album.</p>', 'https://www.youtube.com/embed/OmLNs6zQIHo', 'https://origincode.co/downloads/video-gallery/', 'video', 'on', 1, 1, NULL, '', 'on', 'on'),
	(2, 'Dakar Trail', '1', '<p>The Dakar Rally is an annual rally raid organised by the Amaury Sport Organisation. Most events since the inception in 1978 were from Paris, France, to Dakar, Senegal, but due to security threats in Mauritania, which led to the cancellation of the 2008 rally, races since 2009 have been held in South America.</p>', 'https://player.vimeo.com/video/122404144', 'https://origincode.co/downloads/video-gallery/', 'video', 'on', 2, 1, NULL, '', 'on', 'on'),
	(3, 'Leonard in Slow Motion', '1', '<h6>Leonard in Slow Motion </h6><p>Slow motion is an effect in film-making whereby time appears to be slowed down. It was invented by the Austrian priest August Musger in the early 20th century.</p>', 'https://player.vimeo.com/video/100656498', 'https://origincode.co/downloads/video-gallery/', 'video', 'on', 3, 1, NULL, '', 'on', 'on'),
	(4, 'Flying Into Doha - First Impressions of Qatar', '1', '<p>Qatar officially the State of Qatar, is a country located in Western Asia, occupying the small Qatar Peninsula on the northeastern coast of the Arabian Peninsula. Whether the sovereign state should be regarded as a constitutional monarchy or an absolute monarchy is disputed. Its sole land border is with neighbouring Gulf Cooperation Council monarchy Saudi Arabia to the south, with the rest of its territory surrounded by the Persian Gulf.</p>', 'https://www.youtube.com/embed/CPY6GyXCF5A', 'https://origincode.co/downloads/video-gallery/', 'video', 'on', 4, 1, NULL, '', 'on', 'on'),
	(5, 'Wastelander Panda Prologue', '1', '<h6>Wastelander Panda Prologue</h6><p>The giant panda also known as panda bear or simply panda, is a bear native to south central China. It is easily recognized by the large, distinctive black patches around its eyes, over the ears, and across its round body. The name giant panda is sometimes used to distinguish it from the red panda. Though it belongs to the order Carnivora, the giant panda is a folivore, with bamboo shoots and leaves making up more than 99__5_5_5__ of its diet.</p>', 'https://player.vimeo.com/video/35546493', 'https://origincode.co/downloads/video-gallery/', 'video', 'on', 5, 1, NULL, '', 'on', 'on'),
	(6, 'Ocean!', '1', '<p>An ocean is a body of water that composes much of a planets hydrosphere. On Earth, an ocean is one of the major conventional divisions of the World Ocean. These are, in descending order by area, the Pacific, Atlantic, Indian, Southern (Antarctic), and Arctic Oceans.</p>', 'https://player.vimeo.com/video/25323516', 'https://origincode.co/downloads/video-gallery/', 'video', 'on', 6, 1, NULL, '', 'on', 'on'),
	(7, 'SpaceX launch to the International Space Station', '1', '<p>Space Exploration Technologies Corp., doing business as SpaceX, is a private US aerospace manufacturer and space transportation services company headquartered in Hawthorne, California. It was founded in 2002 by Elon Musk with the goal of reducing space transportation costs to enable the colonization of Mars.SpaceX has developed the Falcon launch vehicle family and the Dragon spacecraft family.</p>', 'https://www.youtube.com/embed/CfRULatzLZQ', 'https://origincode.co/downloads/video-gallery/', 'video', 'on', 7, 1, NULL, '', 'on', 'on'),
	(8, 'Journey Through The Universe', '1', '<h6>Journey Through The Universe - HD Documentary</h6><p>The Universe is all of space and time and their contents, including planets, stars, galaxies, and all other forms of matter and energy. While the spatial size of the entire Universe is unknown, it is possible to measure the size of the observable universe, which is currently estimated to be 93 billion light-years in diameter.</p>', 'https://www.youtube.com/embed/mO3Q4bRQZ3k', 'https://origincode.co/downloads/video-gallery/', 'video', 'on', 8, 1, NULL, '', 'on', 'on'),
	(9, 'Escola SESI', '1', '', 'https://www.youtube.com/watch?v=2jue8yro-CQ&list=PLmA0fWcywl9YSP7hblv3gjzQjDaFq3DGj', 'https://www.youtube.com/watch?v=2jue8yro-CQ&list=PLmA0fWcywl9YSP7hblv3gjzQjDaFq3DGj', 'video', 'on', 0, 1, 1, '', 'on', 'on');
