	(769, 188, 'tituloDestaque', 'Terapia online e presencial'),
	(770, 188, '_tituloDestaque', 'field_618968b3079d0'),
	(771, 188, 'descricaoDestaque', 'Vivemos tempos de muitos desafios e ter alguém que cuide de nossa saúde mental é fundamental. Neste contexto, precisamos estar atentos e atualizados para nos reinventarmos diariamente. Nunca foi tão importante cuidar da saúde mental das pessoas, e este cuidado torna-se cada vez mais presente no dia a dia das empresas.\r\n\r\nA maneira de se relacionar mudou: é preciso encontrar novas formas e abordagens com um olhar integral sobre a saúde, considerando seu aspecto físico e emocional. O SESI está preparado para este momento, oferecendo serviços de terapia online e presencial, conforme preferência de cada pessoa.'),
	(772, 188, '_descricaoDestaque', 'field_618969fcf0acc'),
	(773, 188, 'tituloOnline', 'TERAPIA ONLINE'),
	(774, 188, '_tituloOnline', 'field_61896a21f8803'),
