	(2278, 325, 'tituloDestaque', 'Terapia Online e Presencial'),
	(2279, 325, '_tituloDestaque', 'field_618968b3079d0'),
	(2280, 325, 'descricaoDestaque', 'Vivemos tempos de muitos desafios e ter alguém que cuide de nossa saúde mental é fundamental. Neste contexto, precisamos estar atentos e atualizados para nos reinventarmos diariamente. Nunca foi tão importante cuidar da saúde mental das pessoas, e este cuidado torna-se cada vez mais presente no dia a dia das empresas.\r\n\r\nA maneira de se relacionar mudou: é preciso encontrar novas formas e abordagens com um olhar integral sobre a saúde, considerando seu aspecto físico e emocional. O SESI está preparado para este momento, oferecendo serviços de terapia online e presencial, conforme preferência de cada pessoa.'),
	(2281, 325, '_descricaoDestaque', 'field_618969fcf0acc'),
	(2282, 325, 'tituloOnline', 'TERAPIA ONLINE'),
	(2283, 325, '_tituloOnline', 'field_61896a21f8803'),
	(2284, 325, 'descricaoOnline', 'Atendimento psicológico individual e online, é realizado na plataforma SESI Terapia Online, permitindo agendamento de consultas, conforme o horário e dia de preferência. Além de ser um espaço 100% seguro, confidencial e acolhedor para o seu trabalhador, que será acompanhado pelos melhores profissionais do SESI.'),
	(2285, 325, '_descricaoOnline', 'field_61896a2af8804'),
