	(2293, 325, '_tituloPresencial', 'field_61896ca443a17'),
	(2294, 325, 'descricaoPresencial', 'Atendimento psicológico individual e presencial, é realizado na modalidade in company, proporcionando ao seu trabalhador os melhores profissionais do SESI. Assim, atingimos juntos o objetivo de tratar de problemas emocionais dos trabalhadores, em um espaço especial destinado pela sua empresa.'),
