	(335, 1, '2021-12-29 15:00:31', '2021-12-29 18:00:31', '<!-- wp:paragraph -->\n<p>Ouviram do Ipiranga as margens plácidas<br>De um povo heroico o brado retumbante<br>E o Sol da liberdade, em raios fúlgidos<br>Brilhou no céu da pátria nesse instante</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Se o penhor dessa igualdade<br>Conseguimos conquistar com braço forte<br>Em teu seio, ó liberdade<br>Desafia o nosso peito a própria morte!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ó Pátria amada<br>Idolatrada<br>Salve! Salve!</p>\n<!-- /wp:paragraph -->', 'Brasil', '', 'inherit', 'closed', 'closed', '', '333-revision-v1', '', '', '2021-12-29 15:00:31', '2021-12-29 18:00:31', '', 333, 'http://fiergs.test/?p=335', 0, 'revision', '', 0),
	(336, 1, '2021-12-29 15:02:53', '2021-12-29 18:02:53', '<!-- wp:paragraph -->\n<p>A educação é o processo de facilitar o aprendizado ou a aquisição de conhecimentos, habilidades, valores, crenças e hábitos. Os métodos educacionais incluem o ensino, treinamento, narração de histórias, discussão e pesquisa direcionada. A educação geralmente ocorre sob a orientação de educadores, mas os alunos também podem se auto-educar. A educação pode ocorrer em contextos formais ou informais e qualquer experiência que tenha um efeito formativo na maneira como se pensa, sente ou age pode ser considerada educacional. A metodologia do ensino é chamada pedagogia.</p>\n<!-- /wp:paragraph -->', 'Educação', '', 'publish', 'open', 'open', '', 'educacao', '', '', '2022-01-03 12:16:15', '2022-01-03 15:16:15', '', 0, 'http://fiergs.test/?p=336', 0, 'post', '', 0),
	(337, 1, '2021-12-29 15:02:41', '2021-12-29 18:02:41', '', 'download', '', 'inherit', 'open', 'closed', '', 'download', '', '', '2021-12-29 15:02:41', '2021-12-29 18:02:41', '', 336, 'http://fiergs.test/wp-content/uploads/2021/12/download.jpg', 0, 'attachment', 'image/jpeg', 0),
	(338, 1, '2021-12-29 15:02:53', '2021-12-29 18:02:53', '<!-- wp:paragraph -->\n<p>A educação é o processo de facilitar o aprendizado ou a aquisição de conhecimentos, habilidades, valores, crenças e hábitos. Os métodos educacionais incluem o ensino, treinamento, narração de histórias, discussão e pesquisa direcionada. A educação geralmente ocorre sob a orientação de educadores, mas os alunos também podem se auto-educar. A educação pode ocorrer em contextos formais ou informais e qualquer experiência que tenha um efeito formativo na maneira como se pensa, sente ou age pode ser considerada educacional. A metodologia do ensino é chamada pedagogia.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>A educação formal é geralmente dividida formalmente em estágios como pré-escola ou jardim de infância, escola primária, escola secundária e depois faculdade, universidade ou ensino técnico.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>O direito à educação foi reconhecido por alguns governos e pelas Nações Unidas.[1] Na maioria das regiões, a educação é obrigatória até uma certa idade.</p>\n<!-- /wp:paragraph -->', 'Educação', '', 'inherit', 'closed', 'closed', '', '336-revision-v1', '', '', '2021-12-29 15:02:53', '2021-12-29 18:02:53', '', 336, 'http://fiergs.test/?p=338', 0, 'revision', '', 0),
